@KeDengMS Yes! It works if I spawn a new thread to execute OrtCreateSession, the following is what I changed in my code snap. Notice that I didn't run my inference code on the same thread, and everything seems fine. Is that expected? Or there is pitfall for doing that?
```C++
auto status = std::async(std::launch::async, &OrtCreateSession,
        env, model_paths[idx], context_options, &sessions[idx]);
CHECK_STATUS(status.get());
```
